        <style>
            @import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;600&display=swap');
            body {
                font-family: 'Inter', sans-serif;
                margin: 0;
            }
            #map {
                position: absolute;
                top: 0; bottom: 0;
                left: 0; right: 300px;
            }
            #sidebar {
                position: absolute;
                top: 0; right: 0;
                width: 300px; height: 100%;
                background-color: #fff;
                border-left: 1px solid #ddd;
                overflow-y: auto;
                z-index: 999;
                box-shadow: -2px 0 10px rgba(0,0,0,0.1);
            }
            #sidebar.collapsed {
                right: -300px;
            }
            #sidebar h2 {
                margin: 0;
                padding: 1rem;
                background: #d32f2f;
                color: white;
                font-size: 1.2rem;
            }
            .legend {
                padding: 0.75rem 1rem 0.5rem 1rem;
                border-bottom: 1px solid #ddd;
                font-size: 14px;
            }
            .legend div {
                margin-bottom: 5px;
            }
            ul.crash-list {
                list-style-type: none;
                padding: 0 1rem;
                margin: 0;
            }
            ul.crash-list li {
                padding: 0.75rem 0;
                border-bottom: 1px solid #eee;
                cursor: pointer;
            }
            ul.crash-list li:hover {
                color: #d32f2f;
                font-weight: 600;
            }
            #toggleSidebar {
                position: absolute;
                top: 10px;
                right: 310px;
                background-color: #d32f2f;
                color: white;
                border: none;
                padding: 5px 10px;
                border-radius: 4px;
                cursor: pointer;
                z-index: 1000;
            }
        </style>

        <div id="sidebar">
            <h2>Crash Reports</h2>
            <div class="legend">
                <strong>Legend</strong><br>
                <div><span style="color:red;">●</span> &lt; 30 min</div>
                <div><span style="color:orange;">●</span> 30–90 min</div>
                <div><span style="color:yellow;">●</span> 90–180 min</div>
                <div><span style="color:blue;">●</span> Older than 3 hours</div>
                <div>● Larger = More recent</div>
                <div>● #01 = Most recent crash</div>
            </div>
            <ul class="crash-list">
                
            </ul>
        </div>

        <button id="toggleSidebar">☰</button>

        <script>
            let highlightMarker;
            document.getElementById('toggleSidebar').onclick = function() {
                document.getElementById('sidebar').classList.toggle('collapsed');
            };
            function focusMarker(lat, lon) {
                map.setView([lat, lon], 15);
                if (highlightMarker) {
                    map.removeLayer(highlightMarker);
                }
                highlightMarker = L.circleMarker([lat, lon], {
                    radius: 28,
                    color: 'black',
                    fillColor: 'white',
                    fillOpacity: 0.9
                }).addTo(map);
                setTimeout(() => {
                    if (highlightMarker) map.removeLayer(highlightMarker);
                }, 3000);
            }
        </script>
